    # Function to compute sum of products of all subarrays
    # of given length
    n = int(n)
    sub_prod = [0] * n
    for i in range(n):
        # Current index of subarray
        cur_prod = 1
        for j in range(n):
            # Starting index of subarray
            start = max(0,i-j)
            end = min(n-1,i+j)
