    n = len(nums)
    min_index = 0
    max_index = 0
    min_value = nums[0]
    max_value = nums[0]

    for i in range(1, n):
        if nums[i] < min_value:
            min_index = i
            min_value = nums[i]
        elif nums[i] > max_value:
            max_index = i
            max_value = nums[i]

